import React from 'react'
import UserListItem from './UserListItem'


const UsersList = props => {
    const users = props.list
    return (
        <ul>
            {users.map(user => <UserListItem>{`${user.userName} ${user.age}`}</UserListItem>)}
        </ul>
    )
}

export default UsersList
